        "ledi-documentacao-estrutura-arquivos-header-transport": {
          "title" : "Cabeçalho (headerTransport)",
          "content": "UnicaLotacaoHeader\n\n#1 profissionalCNS\n\nCNS do profissional.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nString\nSim\n15\n15\n\n\n\nRegras:\n\n\nCNS validado de acordo com o algoritmo de validação;\nSomente fichas de profissionais com vínculo com o respectivo município são consideradas válidas.\n\n\nObservações: Esta entidade é utilizada para representar o profissional responsável pelas fichas.\n\n#2 cboCodigo_2002\n\nCódigo do CBO do profissional.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nString\nSim\n-\n-\n\n\n\nRegras: Somente as CBOs apresentadas na tabela da respectiva ficha podem ser adicionadas neste campo.\n\nReferências: Grupos de CBOs x Tipo de ficha.\n\nObservações: Esta entidade é utilizada para representar o profissional responsável pelas fichas.\n\n#3 cnes\n\nCódigo do CNES do estabelecimento de saúde onde o profissional está lotado.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nString\nSim\n7\n7\n\n\n\nRegras: Deve ser preenchido com a mesma informação do campo #3 cnesDadoSerializado.\n\nObservações: Esta entidade é utilizada para representar o profissional responsável pelas fichas.\n\n#4 ine\n\nCódigo INE da equipe do profissional.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nString\nNão\n10\n10\n\n\n\nRegras: Deve ser preenchido com a mesma informação do campo #5 ineDadoSerializado.\n\nObservações: Esta entidade é utilizada para representar o profissional responsável pelas fichas.\n\n#5 dataAtendimento\n\nData em que está sendo realizada a ação.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nLong\nSim\n-\n-\n\n\n\nReferências: A data deve ser apresentada seguindo o padrão Epoch, convertido em milissegundos. Para realizar a conversão, pode ser utilizado o conversor Current millis.\n\nRegras: Não pode ser posterior à data atual.\n\n#6 codigoIbgeMunicipio\n\nCódigo IBGE do município.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nString\nSim\n7\n7\n\n\n\nRegras: Deve ser preenchido com a mesma informação do campo #4 codIbge.\n\nReferências: Municípios.\n\n\n\nLotacaoHeader\n\n\n\n#1  profissionalCNS\n\nCNS do profissional.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nString\nSim\n15\n15\n\n\n\nRegras:\n\n\nCNS validado de acordo com o algoritmo de validação;\nSomente fichas de profissionais com vínculo com o respectivo município são consideradas válidas.\n\n\n\n\n#2  cboCodigo_2002\n\nCódigo do CBO do profissional.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nString\nSim\n-\n-\n\n\n\nRegras:\n\n\nSe for registro de lotacaoFormPrincipal somente as Grupos de CBOs x Tipo de ficha apresentadas na tabela da respectiva ficha podem ser adicionadas neste campo;\nSe for registro de lotacaoFormAtendimentoCompartilhado a referência é a Lista com todas as CBOs.\n\n\n\n\n#3 cnes\n\nCódigo do CNES da unidade de saúde que o profissional está lotado.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nString\nSim\n7\n7\n\n\n\nRegras:\n\n\nSe for registro de lotacaoFormPrincipal, deve ser preenchido com a mesma informação do campo #3 cnesDadoSerializado;\nSe for registro de lotacaoFormAtendimentoCompartilhado, pode ser preenchido com qualquer CNES pertencente ao respectivo município.\n\n\n\n\n#4 ine\n\nCódigo INE da equipe do profissional.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nString\nNão\n10\n10\n\n\n\nRegras:\n\n\nSe for registro de lotacaoFormPrincipal, deve ser preenchido com a mesma informação do campo #5 ineDadoSerializado;\nSe for registro de lotacaoFormAtendimentoCompartilhado, pode ser preenchido com qualquer INE pertencente ao respectivo município.\n\n\nVariasLotacoesHeader\n\n#1 lotacaoFormPrincipal\n\nProfissional responsável pelo atendimento.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nLotacaoHeader\nSim\n-\n-\n\n\n\nReferências: LotacaoHeader.\n\nObservações: Esta entidade é utilizada para representar o profissional responsável pela ficha.\n\n#2 lotacaoFormAtendimentoCompartilhado\n\nProfissional auxiliar no atendimento.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nLotacaoHeader\nNão\n-\n-\n\n\n\nReferências: LotacaoHeader.\n\nObservações: Esta entidade é utilizada para representar um profissional que auxiliou o profissional responsável pela ficha.\n\n#3 dataAtendimento\n\nData em que está sendo realizada a ação.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nLong\nSim\n-\n-\n\n\n\nRegras: Não pode ser posterior à data atual.\n\nReferências: A data deve ser apresentada seguindo o padrão Epoch, convertido em milissegundos. Para realizar a conversão, pode ser utilizado o conversor Current millis.\n\n#4 codigoIbgeMunicipio\n\nCódigo IBGE do município.\n\n\n\nTipo\nObrigatório\nMínimo\nMáximo\n\n\n\nString\nSim\n7\n7\n\n\n\nRegras: Deve ser preenchido com a mesma informação do campo #4 codIbge.\n\nReferências: Municípios.\n",
          "url": "/ledi/documentacao/estrutura_arquivos/header-transport.html"
        }
        
