        "ledi-documentacao-estrutura-arquivos-index": {
          "title" : "Estrutura dos arquivos",
          "content": "Lote\n\nUm lote é um conjunto de arquivos de dados.\n\nArquivo de dados\n\nCada arquivo de dados representa uma ficha.\n\nOs arquivos de dados possuem a mesma macro estrutura, referenciada como camada de transporte. A camada de transporte do arquivo de dados independe do tipo da ficha.\n\nQuando a integração é realizada através do Apache Thrift os arquivos de dados devem ser compactados com extensão &amp;quot;.esus&amp;quot;. Cada arquivo representa um dadoTransport serializado através do TBinaryProtocol.\n\nA estrutura da Camada de Transporte é ilustrada na imagem abaixo:\n\n Camada de transporte - Macro estrutura de um arquivo de dados\n\nA definição de cada um dos elementos da Camada de transporte é apresentada no documento Camada de Transporte de Dados.\n\nO dado serializado possui dois componentes: Cabeçalho e Dados da ficha.\n\n\nO dicionário de dados do Cabeçalho é definido no documento Cabeçalho (headerTransport);\nOs Dados da ficha devem ser estruturados em registros Thrift/XML conforme descrito no documento Registros Thrift / XSD por ficha.\n\n",
          "url": "/ledi/documentacao/estrutura_arquivos/index.html"
        }
        
