        "ledi-documentacao-principais-alteracoes": {
          "title" : "Principais alterações da v4.3.5 para a v4.3.6",
          "content": "Este documento relata as principais alterações em relação à versão v4.3.5 do LEDI APS:\n\n1. Inclusão do procedimento SIGTAP 03.01.07.021-0\n\n1.  Inclusão do procedimento de média complexidade SIGTAP 03.01.07.021-0 - REABILITAÇÃO DE PACIENTES PÓS COVID-19.\n\n2. Inclusão do procedimento SIGTAP 03.01.07.022-9\n\n2.  Inclusão do procedimento de média complexidade SIGTAP 03.01.07.022-9 - REABILITAÇÃO CARDIORRESPIRATÓRIA DE PACIENTES PÓS COVID-19.\n\n3. Disponibilização da Vacina COVID-19 SINOVAC - CORONAVAC inativada no calendário vacinal\n\n3.  Foi incluído a Vacina COVID-19 SINOVAC - CORONAVAC inativada, para registrar aplicações de doses em cidadãos em faixa etária maior ou igual 3 anos. \n\n4. Inclusão de Grupo de Atendimento para Pessoas de 3 a 4 anos\n\n4.  Foi incluído uma nova opção &amp;quot;Pessoas de 3 a 4 anos&amp;quot; no grupo de atendimento de registro de aplicação de vacina.\n",
          "url": "/ledi/documentacao/principais_alteracoes.html"
        }
        
      , 
    
      
