          "content": "Este documento descreve os atributos utilizados no LEDI APS:\n\n\nO LEDI APS é uma camada abstrata que especifica as informações, e seus formatos, que são aceitos no envio de dados de sistemas próprios para o PEC e-SUS APS;\nO LEDI APS pode ser implementado utilizando XML ou Apache Thrift;\nPossui versionamento independente, podendo não corresponder com a respectiva versão do sistema PEC e-SUS APS. A Tabela 1 apresenta a compatibilidade entre as versões do LEDI APS e do PEC e-SUS APS.\n\n\nTabela 1. Compatibilidade entre as versões do LEDI APS e PEC e-SUS APS\n\n\n\nVersão PEC e-SUS APS\nVersão do LEDI APS compatível\n\n\n\n2.0.00 ou superior\nLEDI APS 2.0.0\n\n\n2.1.00 ou superior\nLEDI APS 2.1.0\n\n\n2.1.07 ou superior\nLEDI APS 2.1.1\n\n\n2.2.00 ou superior\nLEDI APS 2.2.0\n\n\n3.0.00 ou superior\nLEDI APS 3.0.0\n\n\n3.0.13 ou superior\nLEDI APS 3.0.1\n\n\n3.2.12 ou superior\nLEDI APS 3.2.1\n\n\n3.2.18 ou superior\nLEDI APS 3.2.2\n\n\n3.2.20 ou superior\nLEDI APS 3.2.4\n\n\n3.2.23 ou superior\nLEDI APS 4.0.0\n\n\n3.2.25 ou superior\nLEDI APS 4.0.1\n\n\n4.0.11 ou superior\nLEDI APS 4.0.2\n\n\n4.0.12 ou superior\nLEDI APS 4.0.3\n\n\n4.0.16 ou superior\nLEDI APS 4.0.4\n\n\n4.1.7 ou superior\nLEDI APS 4.1.2\n\n\n4.1.8 ou superior\nLEDI APS 4.1.3\n\n\n4.1.10 ou superior\nLEDI APS 4.1.4\n\n\n4.2.1 ou superior\nLEDI APS 4.2.0\n\n\n4.2.6 ou superior\nLEDI APS 4.2.1\n\n\n4.2.9 ou superior\nLEDI APS 4.2.3\n\n\n4.3.8 ou superior\nLEDI APS 4.3.1\n\n\n4.3.9 ou superior\nLEDI APS 4.3.2\n\n\n4.3.12 ou superior\nLEDI APS 4.3.3\n\n\n4.5.3 ou superior\nLEDI APS 4.3.4\n\n\n4.5.10 ou superior\nLEDI APS 4.3.5\n\n\n4.5.12 ou superior\nLEDI APS 4.3.6\n\n\n",
