        "dw-fatos-visita-domiciliar": {
          "title" : "Visita domiciliar",
          "content": "Esta estratégia de negócio refere-se aos registros de Visitas Domiciliares e está centrada na tb_fat_visita_domiciliar. Neste registro o campo nu_prontuario é criptografado. \n\n\n\nColunas DW\nReferência LEDI\nReferência sistema\n\n\n\nst_busca_ativa_consulta  st_busca_ativa_exame  st_busca_ativa_vacina  st_busca_ativa_bolsa_familia\n#7 motivosVisita  Somente as opções de busca ativa\nBusca ativa\n\n\nst_acomp_gestante  st_acomp_puerpera  st_acomp_recem_nascido  st_acomp_crianca  st_acomp_pessoa_desnutricao  st_acomp_pessoa_reabil_deficie  st_acomp_pessoa_hipertensao  st_acomp_pessoa_diabetes  st_acomp_pessoa_asma  st_acomp_pessoa_dpoc_enfisema  st_acomp_pessoa_cancer  st_acomp_pessoa_doenca_cronica  st_acomp_pessoa_hanseniase  st_acomp_pessoa_tuberculose  st_acomp_sintomaticos_respirat  st_acomp_tabagista  st_acomp_domiciliados_acamados  st_acomp_condi_vulnerab_social  st_acomp_condi_bolsa_familia  st_acomp_saude_mental  st_acomp_usuario_alcool  st_acomp_usuario_outras_drogra\n#7 motivosVisita  Somente as opções de acompanhamento\nAcompanhamento\n\n\nst_ctrl_amb_vet_acao_educativa  st_ctrl_amb_vet_imovel_foco  st_ctrl_amb_vet_acao_mecanica  st_ctrl_amb_vet_tratamnt_focal\n#7 motivosVisita  Somente as opções de controle ambiental / vetorial\nControle ambiental / vetorial\n\n\nst_mot_vis_cad_att  st_mot_vis_visita_periodica  st_mot_vis_egresso_internacao  st_mot_vis_convte_atvidd_cltva  st_mot_vis_orintacao_prevncao  st_mot_vis_outros\n#7 motivosVisita\nMotivo da visita\n\n\n\nTabela 1. Apresentação das colunas x campos múltipla escolha\n\nAlém das colunas apresentadas na Tabela 1, algumas foram criadas para facilitar o controle sobre os dados registrados:\n\n\nst_mot_vis_busca_ativa: responsável por identificar se alguma opção do grupo Busca ativa foi selecionada;\nst_mot_vis_acompanhamento: responsável por identificar se alguma opção do grupo Acompanhamento foi selecionada;\nst_mot_vis_ctrl_ambnte_vetor: até a versão 2.0, esta opção era única. A partir da versão 2.1, esta coluna foi transformada em um agrupador, responsável por identificar se alguma opção do grupo Controle ambiental / vetorial foi selecionada;\nco_uuid_origem_fcd: responsável por armazenar a informação de qual domicílio recebeu a visita. Corresponde ao campo nu_uuid_ficha_origem da tabela tb_fat_cad_domiciliar.\n\n",
          "url": "/dw/fatos/visita_domiciliar.html"
        }
        
