        "dw-index": {
          "title" : "Data Warehouse Relatórios e-SUS APS PEC",
          "content": "Esta seção descreve a estrutura de Data Warehouse (DW) onde são armazenados os dados para a geração dos relatórios.\n\nO DW é uma base de dados contendo vários componentes. Possui uma arquitetura multidimensional, onde encontram-se as Dimensões e Fatos. Estas estruturas são alguns dos elementos do DW, são dependentes entre si e permitem o armazenamento dos dados.\n\nAtravés de um sistema de ETL, as informações são extraídas de arquivos conforme descritos na estrutura Layout e-SUS APS de Dados e Interface e armazenadas nas tabelas Fatos e Dimensões.\n\nAs Dimensões possuem características descritivas dentro do DW. São responsáveis por qualificar as informações provenientes das tabelas Fatos. As tabelas Fatos possuem características quantitativa dentro do DW. A partir delas, são extraídas métricas que são cruzadas com os dados das Dimensões, gerando informações significativas para a avaliação do usuário. Todos os dados históricos no DW ficam armazenadas nas tabelas Fatos.\n\nCom exceção dos relatórios Operacionais, todos os outros modelos de relatórios do e-SUS APS PEC utilizam esta estrutura de Data Warehouse.\n",
          "url": "/dw/index.html"
        }
        
      , 
    
      
        "dw-principais-alteracoes": {
          "title" : "Principais alterações entre versões",
          "content": "Este documento relata as principais alterações entre as versões do DW.\n\n1. Principais alterações da v4.2.1 para a v4.2.3:\n\n1.  No contexto de Procedimentos foram incluídos os campos nu&amp;#92;_peso e nu&amp;#92;_altura.\n\n2.  No contexto de Atendimento odontológico individual foram incluídos os campos nu&amp;#92;_peso e nu&amp;#92;_altura.\n\n2. Principais alterações da v4.2.0 para a v4.2.1:\n\n1.  No contexto de Cadastro individual foi incluído o campo co_dim_povo_comunidade_tradicional. Além deste campo, também foi criada a tabela de dimensão tb_dim_povo_comunidade_tradicional.\n\n3. Principais alterações da v4.1.4 para a v4.2.0:\n\n1.  No contexto de Atendimento individual e Atendimento odontológico individual foram incluídas as estruturas de dados para registro das informações de resultados de exames. Estas informações estão armazenadas nas tabelas:\n\n\ntb_fat_atd_ind_exames;\ntb_fat_atend_odonto_exames.\n\n\n2.  No contexto de Cadastro domiciliar foram incluídos os campos nu_latitude e nu_longitude.\n\n3.  No contexto de Visita domiciliar foram incluídos os campos nu_latitude, nu_longitude e co_uuid_origem_fcd.\n\n4.  No contexto de Vacinação foram incluídos os campos st_registro_anterior e co_dim_tempo_vacina_aplicada.\n\n4. Principais alterações da v4.1.2 para a v4.1.4:\n\n1.  No contexto de Vacinação foram incluídas as estruturas de dados para registro da informação de grupo de atendimento. Esta informação está armazenada na tabela: tb_fat_vacinacao_vacina.\n\n2.  Para contextualizar as informações da tabela tb_fat_vacinacao_vacina, foi criada a seguinte tabela de dimensão: tb_dim_grupo_atendimento.\n\n5. Principais alterações da v4.0.0 para a v4.1.2:\n\n1.  No contexto de Atendimento individual foram incluídas as estruturas de dados para registro das informações de prescrição de medicamentos e encaminhamentos. Estas informações estão armazenadas nas tabelas:\n\n\ntb_fat_atd_ind_medicamentos;\ntb_fat_atd_ind_encaminhamentos.\n\n\n2.  No contexto de Atendimento odontológico individual foram incluídas as estruturas de dados para registro das informações de prescrição de medicamentos e encaminhamentos. Estas informações estão armazenadas nas tabelas:\n\n\ntb_fat_atend_odonto_medicamentos;\ntb_fat_atend_odonto_encaminhamentos.\n\n\n3.  No contexto de Visita domiciliar foram adicionados os campos nu_medicao_pressao_arterial, nu_medicao_temperatura, co_dim_tipo_glicemia e nu_medicao_glicemia. Além destes campos, também foi criada a tabela de dimensão tb_dim_tipo_glicemia.\n\n4.  Para contextualizar as informações das tabelas tb_fat_atd_ind_medicamentos e tb_fat_atend_odonto_medicamentos, foram criadas as seguintes tabelas de dimensões:\n\n\ntb_dim_catmat;\ntb_dim_via_administracao;\ntb_dim_dose_frequencia;\ntb_dim_dose_frequencia_medida;\ntb_dim_duracao_tratamento_med.\n\n\n5.  Para contextualizar as informações das tabelas tb_fat_atd_ind_encaminhamentos e tb_fat_atend_odonto_encaminhamentos, foram criadas as seguintes tabelas de dimensões:\n\n\ntb_dim_especialidade;\ntb_dim_classificacao_risc_enc.\n\n",
          "url": "/dw/principais_alteracoes.html"
        }
        
      
    
    
  
